export default function CustomDate({ ms }: { ms: string }) {
  // formate the below string however you want
  const blogDate = new Date(ms);
  console.log(blogDate.getFullYear());
  const dateString = blogDate.getMonth() + ' - ' + blogDate.getDay() + ' - ' + blogDate.getFullYear();
  return (
    <p>{dateString}</p> 
  );
}
